import './Navbar.css';
import React, { Component } from "react";
import {
    BrowserRouter as Router,
    Link
} from "react-router-dom";

class Navbar extends React.Component {
    render() {
        return (
            <Router>
                <div className="Navbar">
                    <b>Ethical AI for Computational Action</b>
                    <nav>
                    <ul>
                        <Link to="/">Home</Link> 
                        {' '}|{' '}
                        <Link to="/builder">Build Your Curriculum</Link>
                        {' '}|{' '}
                        <Link to="/presets">Preset Curriculum</Link>
                        {' '}|{' '}
                        <Link to="/all">All Modules</Link>
                    </ul>
                    </nav>

                </div>
            </Router>
        )
    }
}

export default Navbar;
